import React from 'react';
import { Link } from 'react-router-dom';

const PlayerItem = (props) => {
  return (
    <React.Fragment>
      <Link to={`/`}></Link>
      <tr>
        <td>{props.ranking}</td>
        <td>{props.name}</td>
        <td>{props.country}</td>
        <td>{props.age}</td>
        <td>{props.points}</td>
      </tr>
    </React.Fragment>
  );
};

export default PlayerItem;
